import React, { Component, Fragment} from 'react'
import Link from 'next/link'
import Magnet from '../components/magnet.js'

class fridgeMagnets extends Component {

  constructor(props)
  {
    super(props)
  }

  render() {

    return (
      <div>

        <style jsx>
          {`
            .list: {
              position: absolute;
              display: block;
              top: 0;
              left: 0;
              width: calc(#{$finalHeight} + #{$scrollBarHeight});
              max-height: $finalWidth;
              margin: 0;
              padding-top: $scrollBarHeight;
              background: #abc;
              overflow-y: auto;
              overflow-x: hidden;
              transform: rotate(-90deg) 
            },
            .container: {
              flexWrap: 'nowrap',
              // Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
              transform: 'translateZ(0)',
            },
          `}
        </style>

        <div className="list">
          {(
          this.props.stores==null
            ?""
            :this.props.stores.map((store) => (
              <div className=""><Magnet store={store}/></div>
            ))
          )}
        </div>
      </div>
    )
  }
}

export default fridgeMagnets;
